import React from "react";
function App(){
function add(a,b){
    let sum = a+b;
    return sum;
}
function sub(a,b){
    let sub = a-b;
    return sub;
}

function mul(a,b){
    let mul = a*b;
    return mul;
}

function div(a,b){
    let div = a/b;
    div=div.toFixed(2);
    return div;
}

return(
    <>
    <ul>
      <li>{add(40,67)}</li>
      <li>{sub(40,98)}</li>
      <li>{mul(40,5)}</li>
      <li>{div(40,3)}</li>
    </ul>
  </>
);
}


export default App;
